import React, { useEffect, useState } from 'react';
const serverURL = "http://localhost:8080";
const Home = () => {
    const [artists, setArtists] = useState([]);
    const [songs, setSongs] = useState([]);

        const fetchData = async () => {
            try {
                const artistsResponse = await fetch(serverURL + '/artistInfo');
                const artistsData = await artistsResponse.json();
                setArtists(artistsData);

                const songsResponse = await fetch(serverURL + '/songInfo');
                const songsData = await songsResponse.json();
                setSongs(songsData);

            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchData();


    function shuffleArray(array) {
        for (let i = array.length - 1; i > 0; i--) {
          const j = Math.floor(Math.random() * (i + 1));
          [array[i], array[j]] = [array[j], array[i]];
        }
        return array;
      }

    function compareArtists(artist_1, artist_2) {
        var artist_1_score = 0;
        var artist_2_score = 0;

        for (var i = 0; i < songs.length; ++i) {
            if (songs[i].Artist === artist_1) {
                artist_1_score += songs[i].Plays;
            }
            else if (songs[i].Artist === artist_2) {
                artist_2_score += songs[i].Plays;
            }
        }

        if (artist_1_score > artist_2_score) {return 1;}
        else {return 2;}
    }

    function displayArtist() {
        return "Yup";
    }

    function setArtist1String(artist_1, artist_2) {
        if (compareArtists(artist_1, artist_2) === 1) {
            //return artists[0].Name + ": Winner!";
        }
        return artist_1.Name;
    }

    function setArtist2String(artist_1, artist_2) {
        if (compareArtists(artist_1, artist_2) === 2) {
            //return artists[1].Name + ": Winner!";
        }
        return "hi";
    }


    shuffleArray(artists);
    var artist_1 = artists[0];
    var artist_2 = artists[1];

    // var artist_1_string = setArtist1String();
    // var artist_2_string = setArtist2String();

    console.log("ARTISTS BE HERE");
    console.log(artists);

    return (
        <div>
            <h1>Compare</h1>
            <div className='flexContainer'>
                <div class="homeItems">
                    <h2 className='titleText'>{"fug"}</h2>
                    <ul class="infoList">
                        {artists.slice(0, 1).map((artist, index) => (
                            <li key={index}>
                                <div>
                                    <img src={artist.Image} width="220" height="220" alt={artist.Name} />
                                    <div>
                                        <h3>{"fug"} </h3>
                                    </div>
                                </div>
                            </li>
                        ))}
                    </ul>
                </div>
                <div class="homeItems">
                    <h2 className='titleText'>{"fug"}</h2>
                    <ul class="infoList">
                    {artists.slice(1,2).map((artist, index) => (
                            <li>
                                <div>
                                    <img src={artist.Image} width="220" height="220" alt={artist.Name} />
                                    <div>
                                        <h3>{"fug"}</h3>
                                    </div>
                                </div>
                            </li>
                    ))}
                    </ul>
                </div>
            </div>
        </div>
    );

};
export default Home;
